import { Outlet, Form } from "react-router-dom";

const Root = () => {
  const styles = {
    Buttons: {
      width: '20%', 
      height: '100%',
      },
      buttonText: {
        background: '#f16777',
        borderWidth: 0,
        width: '100%',
        height: '100%',
        fontSize: 60,
        fontFamily: 'fantasy'
      }
    }
  return (
    <>
    <div style={{
        width: '100%',
        height: 80,
        background: 'gray',
        flexDirection: 'row',
        display: 'flex'
    }}>
        <Form action="/" style={styles.Buttons}>
        <button style={styles.buttonText}>Home</button>
      </Form>
      <Form action="/Hotels">
        <button>Hotels</button>
      </Form>
      <Form action="/QA">
        <button style={styles.buttonText}>QA</button>
      </Form>
      <Form action="/Help">
        <button style={styles.buttonText}>HELP</button>
      </Form>
      <Form action="/Map">
        <button style={styles.buttonText}>Map</button>
      </Form>
    </div>
    <Outlet/>
    </>
)
};

export default Root;
